import "./GroupComponent6.css";

const GroupComponent6 = () => {
  return (
    <div className="ellipse-container">
      <img className="group-child7" alt="" src="../ellipse-13.svg" />
      <img className="group-child8" alt="" src="../ellipse-23.svg" />
      <img className="group-child9" alt="" src="../ellipse-34.svg" />
    </div>
  );
};

export default GroupComponent6;
